Verenigde Staten
Komedie
124 minuten

geregisseerd door Nicholas Stoller
met Jason Segel, Emily Blunt en Chris Pratt

Het verhaal over twee mensen die verliefd worden op elkaar maar na vijf jaar nog steeds verloofd zijn. Door de dagelijkse drukte (hoofdzakelijk op het werk) ontstaat er behoorlijke stress, en niet alleen bij henzelf, maar ook bij de familieleden. Zal dit koppel evengoed ooit gaat trouwen?




Vertaald door Simply ReleaseS Toppers
JR Jansen, Watchman en Ehr Asjee



